theme.source:
@theme-name: t-tabbox-default;

.@{theme-name} {
  border: solid 1px #dddddd;
}

.@{theme-name}-tabs {

  .w-tabbox-tab {
    float: left;

    a {
      display: inline-block;
      *display: inline;
      zoom: 1;
      font-size: 14px;
      height: 30px;
      line-height: 18px;
      padding: 6px 15px;
      border-right: solid 1px #dedede;
    }
    a,
    a:visited,
    a:hover,
    a:active {
      color: #444444;
    }
  }

  .w-tabbox-list {
    background: #f4f4f4;
    height: 30px;
    border-bottom: solid 1px #dddddd;

    .first {}
    .last {}
    .active {}
    .active a {
      background: #ffffff;
      border-bottom: 1px solid #ffffff;
      margin-bottom: -1px;
    }
  }
}

@theme-name: t-tabbox-01;

.@{theme-name} {
  border: solid 1px #dddddd;
  position: relative;
}

.@{theme-name}-tabs {
  position: absolute;
  left: 0;
  bottom: 0;
  width: 100%;
  height: 30px;

  .w-tabbox-tab {
    float: left;

    a {
      display: inline-block;
      *display: inline;
      zoom: 1;
      font-size: 14px;
      height: 30px;
      line-height: 18px;
      padding: 6px 15px;
      border-right: solid 1px #dedede;
    }

    a,
    a:visited,
    a:hover,
    a:active {
      color: #444444;
    }
  }

  .w-tabbox-list {
    background: #f4f4f4;
    height: 30px;
    border-top: solid 1px #dddddd;

    .active a {
      background: #ffffff;
      border-top: 1px solid #ffffff;
      margin-top: -1px;
    }
  }
}

.@{theme-name}-contents {
  margin-bottom: 31px;
}

@theme-name: t-tabbox-02;

.@{theme-name} {
  overflow: hidden;
}

.@{theme-name}-tabs {
  width: 180px;
  float: left;
  background: #f4f4f4;
  border: solid #dddddd;
  border-width: 1px 0 1px 1px;

  .w-tabbox-tab {
    display: block;

    a {
      width: 180px;
      font-size: 14px;
      height: 30px;
      line-height: 18px;
      padding: 6px 20px;
      border-bottom: solid 1px #dedede;
    }

    a,
    a:visited,
    a:hover,
    a:active {
      color: #444444;
    }
  }

  .w-tabbox-list {
    .last a {
      border-bottom: none;
    }
    .active a {
      width: 180px;
      background: #ffffff;
      margin-right: -1px;
    }
  }
}

.@{theme-name}-contents {
  overflow: hidden;
  zoom: 1;
  border: solid 1px #dddddd;
}

